    function balanceOf(
        address account,
        uint256[] calldata holderTokenIds,
        uint256[] calldata ecosystemTokenIds
    ) external view returns (uint256);

    function withdraw(
        address account,
        uint256[] calldata holderTokenIds,
        uint256[] calldata ecosystemTokenIds
    ) external;
}

